package org.example.model;import jakarta.persistence.Column;import jakarta.persistence.Entity;import jakarta.persistence.Id;import jakarta.persistence.Table;@Table@Entity(name = "employee")public class Employee {    @Id    @Column(name = "employeeId", nullable = false, unique = true, length = 20)    private String employeeID;    @Column(name = "accountNumber")    private String accountNumber;    @Column(name = "password")    private String password;    @Column(name = "isSuperUser")    private boolean isSuperUser;    @Column(name = "branchCode")    private String branchCode;    @Column(name = "isBranchManager")    private boolean isBranchManager;    public String getEmployeeID() {        return employeeID;    }    public void setEmployeeID(String employeeID) {        this.employeeID = employeeID;    }    public String getAccountNumber() {        return accountNumber;    }    public void setAccountNumber(String accountNumber) {        this.accountNumber = accountNumber;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public boolean isSuperUser() {        return isSuperUser;    }    public void setSuperUser(boolean superUser) {        isSuperUser = superUser;    }    public String getBranchCode() {        return branchCode;    }    public void setBranchCode(String branchCode) {        this.branchCode = branchCode;    }    public boolean isBranchManager() {        return isBranchManager;    }    public void setBranchManager(boolean branchManager) {        isBranchManager = branchManager;    }}